import React from 'react'
import './Home.scss'
import Loading from './Loading'

function Home() {



  return (
    <div>
      <h1>WELCOME TO EUNMI's PORTFOLIO</h1>
      {loading ? (<Spinner/>) : (<FormControlLabel
    control={<Checkbox 
    icon={<FavoriteBorder />} 
    checkedIcon={<Favorite />} 
    name="checkedH" />}
    label="PET!"/>
    )}
    </div>
  )
}

export default Home
